import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { Quote, Star, UserCheck } from 'lucide-react';

const Testimonials = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const successStories = [
    {
      name: "Anjali Sharma",
      role: "Software Lead",
      content: "Mamtha's coaching helped me bridge the gap between my technical skills and leadership presence. I didn't just get a promotion; I found my voice.",
      tags: ["Career Transition", "Leadership"],
      rating: 5
    },
    {
      name: "Rohan K.",
      role: "Entrepreneur",
      content: "As a Data Engineer herself, she understood my logical brain but taught me how to navigate my emotions. The 'Mindset Debugging' session was life-changing.",
      tags: ["Emotional Intelligence", "Mindset"],
      rating: 5
    },
    {
      name: "Priya Deshmukh",
      role: "Graduate Student",
      content: "I was lost in informatics data and burnt out. Mamtha taught me how to architect my life with the same precision I use for my databases.",
      tags: ["Work-Life Balance"],
      rating: 5
    },
    {
      name: "Vikram G.",
      role: "Project Manager",
      content: "She doesn't just give advice; she gives you a system. Her informatics background makes her coaching incredibly structured and effective.",
      tags: ["Strategic Growth", "Systems"],
      rating: 5
    }
  ];

  return (
    <section id="testimonials" className="py-24 bg-[#080808] relative overflow-hidden">
      {/* Soft background glow */}
      <div className="absolute top-0 right-0 w-[500px] h-[500px] bg-orange-500/5 blur-[120px] rounded-full -z-10" />

      <div className="container mx-auto px-4 md:px-6">
        <motion.div
          ref={ref}
          className="text-center mb-20"
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          <div className="inline-flex items-center gap-2 px-3 py-1 rounded-full bg-white/5 border border-white/10 text-gray-400 text-xs font-bold uppercase tracking-widest mb-4">
            <UserCheck size={14} className="text-orange-500" />
            Success Stories
          </div>
          <h2 className="text-4xl md:text-6xl font-serif font-bold text-white mb-6">
            Voices of <span className="text-orange-500 italic">Transformation</span>
          </h2>
          <p className="text-gray-400 max-w-2xl mx-auto text-lg font-light leading-relaxed">
            Real stories from individuals who redesigned their personal and professional architecture.
          </p>
        </motion.div>

        <div className="columns-1 md:columns-2 gap-8 space-y-8">
          {successStories.map((story, index) => (
            <motion.div
              key={index}
              className="break-inside-avoid p-8 rounded-[32px] bg-white/[0.03] border border-white/10 hover:border-orange-500/30 transition-all duration-500 group relative"
              initial={{ opacity: 0, y: 30 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ delay: index * 0.1, duration: 0.6 }}
            >
              <Quote className="absolute top-6 right-8 text-orange-500/10 group-hover:text-orange-500/20 transition-colors" size={60} />

              <div className="flex gap-1 mb-4">
                {[...Array(story.rating)].map((_, i) => (
                  <Star key={i} size={14} className="text-orange-500 fill-orange-500" />
                ))}
              </div>

              <p className="text-gray-300 text-lg font-light leading-relaxed mb-8 italic">
                "{story.content}"
              </p>

              <div className="flex flex-wrap gap-2 mb-6">
                {story.tags.map((tag, i) => (
                  <span key={i} className="text-[10px] uppercase tracking-widest font-bold text-orange-500/80 bg-orange-500/5 px-3 py-1 rounded-full border border-orange-500/10">
                    {tag}
                  </span>
                ))}
              </div>

              <div className="flex items-center gap-4 border-t border-white/5 pt-6">
                <div className="w-12 h-12 rounded-full bg-gradient-to-tr from-orange-500 to-orange-300 flex items-center justify-center text-black font-bold text-lg">
                  {story.name.charAt(0)}
                </div>
                <div>
                  <h4 className="text-white font-bold">{story.name}</h4>
                  <p className="text-gray-500 text-sm">{story.role}</p>
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        <motion.div
          className="mt-20 text-center"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ delay: 0.8 }}
        >
          <p className="text-gray-400 mb-8 italic">Ready to be the next success story?</p>
          <motion.a
            href="#contact"
            className="px-10 py-4 bg-white text-black rounded-2xl font-bold hover:bg-orange-500 hover:text-white transition-all shadow-xl inline-block"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Start Your Journey Today
          </motion.a>
        </motion.div>
      </div>
    </section>
  );
};

export default Testimonials;
